import React from "react";
import "./Square.css";

export default function Square({ width, height, rotation, colors }) {
  return (
    <div
      style={{
        width: width,
        height: height,
        transform: `rotate(${rotation}deg)`,
        position: relative,
      }}
    >
      <div
        style={{
          width: width - 6,
          height: height - 6,
          border: `1px solid grey`
        }}
      ></div>
      <div
        style={{
          width: width - 6,
          height: height - 6,
        }}
      ></div>
    </div>
  );
}
